It’s becoming increasingly clear that elitist criminals in government, media, and corporations are pushing forward a carefully-orchestrated agenda to establish a global society of technocracy. This agenda appears to include:

    vaccines which may be mandatory (or coerced via digital certificates, wristbands, or social credit score);
    a rapid, covert expansion of 5G;
    global biometric systems (such as this) to track who has been vaccinated or recovered from COVID-19;
    the continuing implosion of the economy to make the public dependent on the State;
    a digital currency linked to the biometrics and 5G;
    fear-based social control system to normalize “social distancing” and unjustified fear of other human beings.

NO CHANGE TO CLIMATE OF ABC HOT AIR (by Chris Kenny in The Australian)

ABC’S ROGUE MANAGEMENT IS DETERMINED TO SERVE GLOBALIST MARXISM AGAINST CHAIR ITA BUTTROSE’S INSTRUCTION

Chris Kenny:  emails circulate throughout the ABC to organise the spreading of misleading Marxist-Globalist environmental propaganda that undermines Australian national interests: https://www.theaustralian.com.au/business/media/no-change-to-climate-of-hot-air-for-abc-staff/news-story/cdea7c9f6a6edba2abbbcf3d55e63e01

Chris Kenny’s article in The Australian revealed that:
1. Staff emails show an “ABC-Staff climate crisis advisory group” is proceeding to form in defiance of the board and management, and that senior staff have pushed the ABC to adopt a climate advocacy role like The Guardian;
2. Senior management have been considering “solutions-based” journalism on climate change — a form of reporting akin to advocacy under another guise;
3. Melbourne-based radio producer Barbara Heggen initiated the move when she sent an email to an ABC-wide list on Sunday, November 17, proposing to establish the climate group;
4. The Australian’s media editor Leo Shanahan reported this later that day;
5. Two days later, ABC chair Ita Buttrose told ABC radio that this was “one of those ideas that is not going to happen” because “the ABC leadership team and managing director have thought otherwise”. 
6. Yet the day after her firm ruling ABC staff anonymously briefed The Guardian Australia that the climate crisis group would not be stopped;
7. ABC internal emails from January this year show staff have ignored Buttrose’s edict. Heggen was trying to set up a Melbourne meeting and got plenty of encouragement from colleagues;

This is exactly the same pattern of activism as in other Western democracies where organisations established by George Soros, who represents Marxist globalism, mislead and indoctrinate the public, and undermine the existing culture and social order. 

So far, there hasn’t been any meaningful response from ABC management or the Government to stop this subversion. 
Why? These agents that are working to destroy Australia are funded by the taxpayers.  Surely, this funding can be stopped. ABC should be divided, some rural services could be government-funded to support our rural communities and the rest should be privatised.  

The other national broadcasters the American ABC, BBC, CBC also emit this most malignant, false, Marxist-socialist propaganda; they’re all funded by the poor deceived taxpayer. Many private broadcasters, like the CNN, echo this so the damage that springs from broadcasters fed on taxpayers money spreads like wildfire.  

These ABC emails were released in response to IPA’s Evan Mulholland’s request under the Freedom of Information Act.

Many officers out there are trampling on people’s liberties. Ask yourself are you doing the right thing? 
